Creating a Table local person = { name = "John", age = 30
} print(person.name) -- Output: John Adding Methods to a Table local person = { name = "John", age = 30, greet = function(self) return "Hello, my name is " .. self.name end
} print(person:greet()) -- Output: Hello, my name is John Metatables Metatables allow you to define custom behavior for tables. For example, you can create a metatable to define how tables are added together. local mt = { __add = function(t1, t2) return t1.value + t2.value end
} local t1 = {value = 10}
local t2 = {value = 20}
setmetatable(t1, mt)
setmetatable(t2, mt) print(t1 + t2) -- Output: 30

